import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider,
  HttpLink,
  ApolloLink,
  gql,
} from '@apollo/client';
const themeQuery = gql`
  query Theme {
    theme {
      light
    }
  }
`;

export default themeQuery;
